import "./Bottom.css";

const Bottom = ({title, leftChild, rightChild}) => {
    return (
        <div className="Bottom">
            <div className="bottom_left">{leftChild}</div>
            {/* <div className="bottom_title">{title}</div> */}
            <div className="bottom_right">{rightChild}</div>
        </div>
    )
}

export default Bottom;
